import React from "react";
import "./Timeline.css";
import timelineImage from "./timelines.png"; // import the image

function Timeline() {
  return (
    <div className="Timelinecontainer">
      <div className="LeftHalf">
        <div className="TimelineHeading">TIMELINE</div>
      </div>
      <div className="RightHalf">
        <img src={timelineImage} alt="timeline" className="Image"></img>
        <div className="Stage1">
          <h1 className="header1">4 March 2024</h1>
          <p1 className="p1">Registration Open</p1>
        </div>
        <div className="Stage2">
          <h1 className="header2">4 March 2024</h1>
          <p1 className="p2">Registration Open</p1>
        </div>
      </div>
    </div>
  );
}

export default Timeline;
